window.bookSummaryJSON = "<p>The fifth Ryan Lock novel from best-selling author Sean Black. When college basketball coach Malik Shaw goes missing after a family tragedy, it looks like just another retired athlete gone off the rails. But Malik's childhood friend, private security specialist Ty Johnson, quickly begins to suspect that there is more to it. Chasing the truth, Ty and his business partner, Ryan Lock, begin to uncover a sinister conspiracy of silence in a sleepy Minnesota college town. </p> <p>The Ryan Lock series has been translated into Dutch, French, German, Italian, Russian and Spanish and has featured on a number of best seller lists. </p>"; 
